import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Form, Button, Table } from 'react-bootstrap';
import { Bar, Line, Pie } from 'react-chartjs-2';
import axios from 'axios';

const Analiticos = () => {
    const [data, setData] = useState({
        busquedas: [],
        paisesData: [],
        evolucionData: [],
        heatmapData: [],
        tipoAccesoData: []
    });
    const [filtros, setFiltros] = useState({
        pais: '',
        fechaDesde: '',
        fechaHasta: '',
        tipoAcceso: ''
    });

    useEffect(() => {
        fetchDatos();
    }, []);

    const fetchDatos = async () => {
        try {
            const response = await axios.get('/api/analiticos/busquedas');
            setData(prev => ({ ...prev, busquedas: response.data }));
            // Aquí podrías llamar a más endpoints para rellenar el resto de datos
        } catch (error) {
            console.error('Error al cargar los datos de analítica:', error);
        }
    };

    const handleFiltroChange = (e) => {
        setFiltros({
            ...filtros,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmitFiltros = (e) => {
        e.preventDefault();
        fetchDatos(); // Podrías ajustar esta función para aplicar los filtros
    };

    // Opciones de gráficos (puedes modificar esto como prefieras)
    const barOptions = {
        responsive: true,
        plugins: {
            legend: {
                position: 'top',
            }
        },
    };

    const lineOptions = {
        scales: {
            y: {
                beginAtZero: true
            }
        }
    };

    const pieOptions = {
        responsive: true,
        plugins: {
            legend: {
                position: 'right',
            }
        },
    };

    // Simulando datos de gráficas
    const barData = {
        labels: data.paisesData.map(d => d.pais),
        datasets: [
            {
                label: 'Número de búsquedas por país',
                data: data.paisesData.map(d => d.cantidad),
                backgroundColor: 'rgba(255, 99, 132, 0.5)',
            },
        ],
    };

    const lineData = {
        labels: data.evolucionData.map(d => d.fecha),
        datasets: [
            {
                label: 'Búsquedas a lo largo del tiempo',
                data: data.evolucionData.map(d => d.cantidad),
                fill: false,
                borderColor: 'rgb(75, 192, 192)',
                tension: 0.1
            }
        ]
    };

    const pieData = {
        labels: ['Web', 'REST'],
        datasets: [
            {
                label: 'Tipo de Acceso',
                data: [data.tipoAccesoData.web, data.tipoAccesoData.rest],
                backgroundColor: [
                    'rgba(255, 205, 86, 0.7)',
                    'rgba(54, 162, 235, 0.7)'
                ],
                hoverOffset: 4
            }
        ]
    };

    return (
        <Container fluid>
            <Row>
                <Col md={12}>
                    <h2>Análisis de Búsquedas</h2>
                    <Form onSubmit={handleSubmitFiltros}>
                        <Row>
                            <Col>
                                <Form.Group controlId="filtroPais">
                                    <Form.Label>País</Form.Label>
                                    <Form.Control type="text" placeholder="Introduzca país" name="pais" value={filtros.pais} onChange={handleFiltroChange} />
                                </Form.Group>
                            </Col>
                            <Col>
                                <Form.Group controlId="filtroFechaDesde">
                                    <Form.Label>Fecha Desde</Form.Label>
                                    <Form.Control type="date" name="fechaDesde" value={filtros.fechaDesde} onChange={handleFiltroChange} />
                                </Form.Group>
                            </Col>
                            <Col>
                                <Form.Group controlId="filtroFechaHasta">
                                    <Form.Label>Fecha Hasta</Form.Label>
                                    <Form.Control type="date" name="fechaHasta" value={filtros.fechaHasta} onChange={handleFiltroChange} />
                                </Form.Group>
                            </Col>
                            <Col>
                                <Form.Group controlId="filtroTipoAcceso">
                                    <Form.Label>Tipo de Acceso</Form.Label>
                                    <Form.Control as="select" name="tipoAcceso" value={filtros.tipoAcceso} onChange={handleFiltroChange}>
                                        <option value="">Seleccione</option>
                                        <option value="web">Web</option>
                                        <option value="rest">REST</option>
                                    </Form.Control>
                                </Form.Group>
                            </Col>
                            <Col md={2} className="align-self-end">
                                <Button type="submit" className="w-100">Aplicar Filtros</Button>
                            </Col>
                        </Row>
                    </Form>
                </Col>
            </Row>
            <Row className="mt-4">
                <Col md={6}>
                    <h4>Búsquedas por País</h4>
                    <Bar data={barData} options={barOptions} />
                </Col>
                <Col md={6}>
                    <h4>Evolución de Búsquedas</h4>
                    <Line data={lineData} options={lineOptions} />
                </Col>
            </Row>
            <Row>
                <Col md={6}>
                    <h4>Heatmap de Actividad</h4>
                    {/* Componente Heatmap aquí */}
                </Col>
                <Col md={6}>
                    <h4>Distribución del Tipo de Acceso</h4>
                    <Pie data={pieData} options={pieOptions} />
                </Col>
            </Row>
        </Container>
    );
};

export default Analiticos;
